I LOVE food.

I stumbled, against my will and into the gym back in 2017 - I weighed 57kgs.

I truly ventured into fitness in 2018, after having gained 12kgs over a year, most of it fat - I weighed 69kgs.

I realised something was extremely off when I was obsessively thinking about food all day, night, falling asleep to the thoughts of tomorrow's food, counting every calorie, starving if I didn't have calories left for the day and overindulging on account of a stressful day. I was unhappy, as of Jul 2020. I weighed 56kgs.

I'm now truly venturing into nourishing my body, loving myself for who I am, what I am capable of, what I deserve, moving my body the way it feels good. I weigh 60kgs.

I don't come with "thin privilege". I know that no matter how small, thin, fit, muscular I become, I'll ALWAYS be a fat child. Why? 

That child was happy. Bullied? Yes. Moved a lot, ran and played a lot? Also, yes. But happy.

I miss that child. I had gotten fitter. AND unhappier. Why? Why did I lose my happiness along with my fat?

I'm learning now. I'm unlearning what the diet culture taught me and relearning how to be human and whole again. If it means being so in a round body, so be it.

I used to follow a lot of fitpros (who gave out great, scientifically backed advise, which truly helped me reach my goal THEN). I now follow coaches who promote well rounded development. Wholesome development. I've tagged those coaches in this post as a tribute, maybe as a starting point for anyone who reads this, realizes they want it and are wondering where to start.

This? This is my corner where I document my journey. My journey to love myself again, to nourish myself, to move myself and feel at home in my body. I follow folks who are naturally "thin" and appear "fit". What is it like for the regular Jane who is bigger and has just started the journey?

That's this account. No advise. My unedited, raw journey. However long it takes ‚ô•Ô∏è

